import React from 'react'
import Layout from "../_layouts/default/Layout";

class SuggestPage extends React.Component {

    render() {
        return (
            <Layout title="Предложить идею">
                <div>
                    Suggest Form
                </div>
            </Layout>
        )
    }
}

export default SuggestPage
